import React from 'react';
import { Navbar, Nav, Container, Button, Card } from 'react-bootstrap';
import { FaHeartbeat, FaMobileAlt, FaBatteryFull, FaSyncAlt, FaLaptopMedical } from 'react-icons/fa';

// Inline CSS for customization
const styles = {
  body: {
    fontFamily: "'Arial', sans-serif",
    lineHeight: 1.6,
    backgroundColor: '#f4f4f9',
    color: '#333',
    padding: '0 1rem',
  },
  nav: {
    backgroundColor: '#6a82fb',
    marginBottom: '2rem',
  },
  navLink: {
    color: '#fff',
    marginRight: '1rem',
  },
  section: {
    padding: '4rem 2rem',
    margin: '0 auto',
    maxWidth: '1200px',
    borderRadius: '8px',
    backgroundColor: '#fff',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
  },
  sectionTitle: {
    marginBottom: '1.5rem',
    color: '#333',
  },
  featureCard: {
    border: 'none',
    borderRadius: '8px',
    marginBottom: '2rem',
    padding: '2rem',
    backgroundColor: '#f9f9f9',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
  },
  icon: {
    fontSize: '2.5rem',
    color: '#6a82fb',
    marginBottom: '1rem',
  },
  button: {
    backgroundColor: '#6a82fb',
    borderColor: '#6a82fb',
    padding: '0.5rem 2rem',
    borderRadius: '25px',
    fontSize: '1rem',
    fontWeight: '600',
  },
};

const ProductPage = () => {
  return (
    <div style={styles.body}>
      {/* Navigation Bar */}
      <Navbar expand="lg" style={styles.nav}>
        <Container>
          <Navbar.Brand href="#" style={{ color: '#fff' }}>sensAIra</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link href="#features" style={styles.navLink}>Features</Nav.Link>
              <Nav.Link href="#pricing" style={styles.navLink}>Pricing</Nav.Link>
              <Nav.Link href="#contact" style={styles.navLink}>Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Hero Section */}
      <section id="hero" className="text-center py-20 bg-blue-600 text-white">
        <h1 className="text-4xl font-bold mb-4">Transform Your Health with sensAIra</h1>
        <p className="text-lg mb-6">AI-powered wearable for proactive health monitoring</p>
        <Button variant="light" className="mt-4" style={styles.button}>Get Started</Button>
      </section>

      {/* Key Features Section */}
      <section id="features" className="py-5" style={styles.section}>
        <h2 style={styles.sectionTitle}>Key Features</h2>

        <div className="d-flex justify-content-center flex-wrap">
          {/* Predictive Analytics */}
          <Card style={styles.featureCard} className="col-lg-4 col-md-6 col-12">
            <FaHeartbeat style={styles.icon} />
            <h4>Predictive Analytics</h4>
            <p>Our AI models predict COPD exacerbations and hypertension spikes by analyzing SpO2, heart rate, and activity trends, providing timely risk alerts.</p>
          </Card>

          {/* Emergency Alerts */}
          <Card style={styles.featureCard} className="col-lg-4 col-md-6 col-12">
            <FaMobileAlt style={styles.icon} />
            <h4>Emergency Alerts</h4>
            <p>In case of serious health issues, the device sends instant alerts to your emergency contacts and nearby hospitals, providing real-time health data for quick assistance.</p>
          </Card>

          {/* Personalized Care Plans */}
          <Card style={styles.featureCard} className="col-lg-4 col-md-6 col-12">
            <FaLaptopMedical style={styles.icon} />
            <h4>Personalized Care Plans</h4>
            <p>Generate real-time health reports that help doctors create precise, personalized treatment plans, improving care effectiveness.</p>
          </Card>
        </div>
      </section>

      {/* AI-Based Risk Detection */}
      <section className="text-center py-5" style={styles.section}>
        <h2 style={styles.sectionTitle}>AI-Based Risk Detection</h2>
        <p>Advanced AI models process biological data such as heart rate and SpO2 to identify potential health risks early, enabling timely interventions for better outcomes.</p>
      </section>

      {/* LED Severity Indicator */}
      <section className="text-center py-5 bg-light" style={styles.section}>
        <h2 style={styles.sectionTitle}>LED Severity Indicator</h2>
        <p>The integrated LED strip shows health risk levels in real-time. With three severity modes, the user gets an instant understanding of their health status.</p>
      </section>

      {/* Dual Battery System */}
      <section className="text-center py-5" style={styles.section}>
        <h2 style={styles.sectionTitle}>Dual Battery System</h2>
        <p>Our device features a dual battery system for continuous 24/7 use. One battery charges while the other powers the device, ensuring uninterrupted monitoring.</p>
      </section>

      {/* Pricing Section */}
      <section id="pricing" className="text-center py-5" style={styles.section}>
        <h2 style={styles.sectionTitle}>Simple, Transparent Pricing</h2>
        <p>₹1999 for the device + 3 months free subscription. ₹99/month thereafter.</p>
        <Button variant="primary" className="mt-4" style={styles.button}>Buy Now</Button>
      </section>
    </div>
  );
};

export default ProductPage;
